export function apiPoint(x) {

 
 let point =    setTimeout(() => {
      fetch("http://183.88.219.85:7078/appoint/point.php", {
        method: "POST",
        body: JSON.stringify({
          a: x
        })
      })
        .then(res => res.json())
        .then(res => {
          return res
        })

    }, 10000)

  return point
  // show
}
